import React, {useEffect} from "react";
import { Link } from "react-router-dom";
import './SearchBar.css'
import logo from '../../img/524_supermario.png';
import { Listado } from "../../Redux/actions";
import {connect} from 'react-redux'


const SearchBar = ({ allVideoGamer, Listado}) =>{


  

  const ejemplo =async ()=>{
   const mirar = await Listado();

  
    console.log("Esto es lo del stock " + mirar[0] );
  }  
  
  console.log("Estado de la tienda:", JSON.stringify(allVideoGamer[0]));


    return(<div className="containersear">
            
            <img className="logo" src={logo} alt="mario bros"/>

            <div className="accesos"> 
            
                                <Link to='/Home'>
                                <button className="botones">Home</button>
                                </Link>
                               
                                <Link to='/Form'>
                                  <button className="botones">Form</button>
                                </Link>
                                <Link to='/About'>
                                <button className="botones">About</button>
                                </Link>

                               
                                <button className="botones" onClick={ejemplo}>Otro</button>

                                                     
            </div>
            <div className="ingreso">
                <input type="text" name="search"  className="ingresoinput"/>
            </div>

           

    </div>)
}
const mapStateToProps= (state)=>{
  return {
    allVideoGamer: state.allVideoGamer
  }
  
}
const mapDispatchToProps = (dispatch)=>{
  return {
    Listado: ()=>{dispatch(Listado())}
  }
} 

export default connect(
                        mapStateToProps,
                        mapDispatchToProps
                        )(SearchBar)
